Hayao Miyazaki gained widespread attention in Japan for his complex ecological manga series, NausicaÃƒÂ¤ of the Valley of the Wind (1982), which he adapted for the screen two years later.
 One thousand years after a war devastated much of the Earth, humanity clings to existence at the fringes of a vast, polluted forest inhabited by monstrous insects.
 Only NausicaÃƒÂ¤, the princess of the tiny realm of the Valley of the Wind, grasps the environmental significance of the forest. She sees beyond petty wars and national rivalries to the only viable future for the planet.
 In NausicaÃƒÂ¤, Miyazaki began to explore elements he would develop more fully in his later films: daring, compassionate heroines; exciting flying sequences; colorful side characters; strong interpersonal relationships; and a call for an ecologically sustainable way of life. NausicaÃƒÂ¤ prefigures Sheeta in Castle in the Sky and Chihiro in Spirited Away, just as the rough and ready Asbel anticipates Pazu in Castle in the Sky and Ashitaka in Princess Mononoke.
 For years, NausicaÃƒÂ¤ was available in the United States only as the badly re-edited Warriors of the Wind.
 The new English dub from Disney presents the film in its entirety, with strong vocal performances by Uma Thurman, Patrick Stewart, Alison Lohman, and Edward James Olmos.

